import React from 'react';
import { Typography } from '@mui/material';
import Grid from '@mui/material/Grid';
import Divider from '@mui/material/Divider';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
import Select from '@mui/material/Select'
import SearchIcon from '@mui/icons-material/Search';
import AddIcon from '@mui/icons-material/Add';

const ToDoList = () => {
    const [age, setAge] = React.useState('');

    const handleChange = (event) => {
        setAge(event.target.value);
    };

    return (
        <Grid container>
            <Grid item xs={12} >
                <Typography variant='h4'>To Do List</Typography>
                <Divider />
            </Grid>
            <Grid container xs={12} mt={3}>
                <Grid container xs={6} direction="row" columns={12}>
                    <Grid item xs={6}>
                        <TextField 
                            id="outlined-basic" 
                            color="secondary"
                            label="Tìm kiếm" 
                            variant="outlined" 
                            size="small"
                            placeholder="Nhập tên công việc"
                        />
                        <Button variant="contained"  color="secondary" endIcon={<SearchIcon />}>Tìm</Button>
                    </Grid>
                    <Grid item xs={3}>
                        <FormControl fullWidth >
                            <InputLabel id="demo-simple-select-label">Sắp xếp theo</InputLabel>
                            <Select
                                labelId="demo-simple-select-label"
                                id="demo-simple-select"
                                value={age}
                                label="Sắp xếp theo"
                                onChange={handleChange}
                                size="small"
                            >
                                <MenuItem value={10}>Ten</MenuItem>
                                <MenuItem value={20}>Twenty</MenuItem>
                                <MenuItem value={30}>Thirty</MenuItem>
                            </Select>
                        </FormControl>
                    </Grid>
                </Grid>
                <Grid item xs={6}>
                    <Button variant="contained" endIcon={<AddIcon />}  color="secondary" fullWidth>Thêm công việc</Button>
                </Grid>
                <Grid container xs={12} mt={2}>
                    <Grid item xs={6} />
                    <Grid item xs={6}>
                        <TextField 
                            label="Tìm kiếm" 
                            variant="outlined" 
                            size="small"
                            placeholder="Nhập tên công việc"
                            color="secondary"
                        />
                    </Grid>
                </Grid>
            </Grid>
        </Grid>
    )
}

export default ToDoList;
